public double MedianOfFive(double a, double b, double c, double d, double e)\n{\n    // Order the first four elements\n    if (b < a) { var temp = a; a = b; b = temp; }\n    if (d < c) { var temp = c; c = d; d = temp; }\n    \n    // Compare the paired elements and set the minimum of each pair\n    if (c < a) { var temp = a; a = c; c = temp; }\n    \n    // Compare the fifth element with the remaining elements\n    if (e < b) { var temp = b; b = e; e = temp; }\n    if (d < c) { var temp = c; c = d; d = temp; }\n    \n    // Final comparisons to determine the median\n    if (c < b) { var temp = b; b = c; c = temp; }\n    if (e < c) return c;\n    else return e;\n}